                            Description = "“Nema veće snage od vremena i većeg manipulatora od života. Život nas uhvati na prepad dok smo mladi, pokaže nam stotine puteva i prepusti vremenu. Mi onda lutamo tim putevima, nekad zalutamo, nekad se vratimo.... Maštamo probamo... I onda se jedno jutro (a to se, vjerujem, svakom dogodilo) nađemo pred nekim ogledalom i spoznamo šta nam je vrijeme neprimijetno napravilo.... Pokušavamo naći onog davnog sebe u tom licu preko puta. Sjetimo se šta smo sve sanjali, planirali... Pitamo se jesmo li i gdje smo zalutali, je li moglo drugačije.... Ovo je priča o tim snovima mladosti i mjestima gdje su nas život i vrijeme doveli...  Ovo je naš pokušaj da budemo ogledalo u kojem ćete prepoznati nešto svoje i možda razmisliti malo o nekim bitnim „malim“ stvarima svog života. Ovo je pokušaj da se igramo i u toj igri dotaknemo i suza i smijeha  i svijetlog i tamnog koje svako od nas u životu ima. A da li smo uspjeli, vrijeme će pokazati....”, zapisao je o predstavi reditelj Jasmin Krpo",
